import {PortFolioList} from '../data/portfolioList';

export default (props) => {
    return (

        PortFolioList.map((portfolio)=>{
<div className="main-content">
            <div className="container">
                <h2>{props.title}</h2>
            </div>
        </div>
        })

    );
}
